import React from 'react';
import Form from '../../../../../General/Form/form.js'
import './roundTrip.css'

class Roundtrip extends React.Component{
  constructor(props) {
  super(props);
  this.state = {
    input: {},
    errors: {}
  };
   
  this.handleChange = this.handleChange.bind(this);
  this.handleSubmit = this.handleSubmit.bind(this);
}
   
handleChange(event) {
  let input = this.state.input;
  input[event.target.name] = event.target.value;

  this.setState({
    input
  });
}
   
handleSubmit(event) {
  event.preventDefault();
  console.log(this.state);
  let input = {};
  input["from"] = "";
  input["to"] = "";
  input["fromdate"] = "";
  input["todate"] = "";
  this.setState({input:input});
}
  render() {
    return (
        <form className="form mx-5 mt-2 pb-4" action="#">
         <div class="form-group">
          <label for={this.props.data.labelname} >{this.props.data.LabelTitle}</label>
          <input 
            type={this.props.data.InputType} 
            name={this.props.data.InputName} 
            value={this.state.input.from}
            onChange={this.handleChange}
            class="form-control" 
            placeholder={this.props.data.Placeholder} 
            id="username" />

            <div className="text-danger">{this.state.errors.username}</div>
        </div>
        </form>
      )
    }
  }
export default Roundtrip
